import React,{Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Body-navbar.css';
import {
  BrowserRouter as Router,
   Link,Route,Switch,NavLink
} from "react-router-dom";
import Home from '../Out/Home/Home';
// import Contact from '../Out/Contact/Contact';
import Shirt from '../Out/Shirt/Shirt';
import Products from '../Out/Products/Products';
import Routershirt from '../Out/Shirt/Router';
import Contact from '../Out/Contact/Contact';
import Login from '../Login';
import Cart from '../Out/Cart/Cart';

class Bodynavbar extends Component {
  render(){
  return (
    <Router>
      <div class="navbar1">
        <NavLink to="/"><i class="fas fa-home"></i></NavLink>
        <div class="subnav">
          <button class="subnavbtn"><NavLink to="/shirt">Áo</NavLink> </button>
          <div class=" subnav-content ">
            <div className="row">
              <a className="col-6">
                <div className="abc1"><b>Áo</b></div>
                <div className="abcd">Sản phẩm mới</div>
                <div className="abcd">Áo sơ mi</div>
                <div className="abcd">Áo thun</div>
                <div className="abcd">Áo khoác</div>
              </a>
              <a className="col-6">
                <img className="img1"  src="http://localhost:4000/anh/menu-ao-92w"></img>
              </a>
            </div>
          </div>
        </div>
      </div>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/contact" exact component={Contact} />
        <Route path="/shirt" exact component={Shirt} />
        <Route path="/shirt/aaa"  component={Products} />
        <Route path="/:name"  component={Products} />
        <Route path="/login" component={Login}></Route>
        <Route path="/cart" component={Cart}></Route>
      </Switch>

    </Router>
  );
}}

export default Bodynavbar;
